import Link from 'next/link'

function HomePage() {
  return (
  	<div>
  		Go to <Link href="/about"><a>About</a></Link>
  		<img src="/vercel.svg" alt="Vercel Logo" className="logo" />
  	</div>
  );
}

export default HomePage
